import React from "react";
import styles from "./Header.module.css";
import HeaderCartButton from "./HeaderCartButton";
import mealsImage from "../../assets/meals.jpg";
const Header = (props) => {
  return (
    <React.Fragment>
      <header className={styles.header}>
        <img src="retail-logo.png"></img>
        <HeaderCartButton onClick={props.onShowCart} />
      </header>
      <div className={styles.nav}>
        <ul>
          <li className={styles.navItem}>Sales</li>
          <li className={styles.navItem}>Fresh Produce</li>
          <li className={styles.navItem}>Meat</li>
          <li className={styles.navItem}>Fish</li>
          <li className={styles.navItem}>Dairy</li>
          <li className={styles.navItem}>Bakary</li>
        </ul>
      </div>
    </React.Fragment>
  );
};
export default Header;
